// SecondPage.tsx
import React from 'react';
import { View, Text, Button, StyleSheet } from 'react-native';

interface SecondPageProps {
  navigation: any; // Use the appropriate type for navigation
}

const SecondPage: React.FC<SecondPageProps> = ({ navigation }) => {
  return (
    <View style={styles.container}>
      <View style={styles.content}>
        <Text style={styles.heading}>Welcome to My App!</Text>
        <Text style={styles.subtext}>Get started by exploring our features.</Text>
        <Button title="Get Started" onPress={() => console.log("Get Started pressed")} />
      </View>
      <Button
        title="Go Back"
        onPress={() => navigation.goBack()}
      />
    </View>
  );
};

const styles = StyleSheet.create({
  container: {
    flex: 1,
    backgroundColor: 'red',
    justifyContent: 'center',
    alignItems: 'center',
  },
  content: {
    justifyContent: 'center',
    alignItems: 'center',
    marginBottom: 20,
  },
  heading: {
    fontSize: 24,
    fontWeight: 'bold',
    color: 'white',
    marginBottom: 10,
  },
  subtext: {
    fontSize: 16,
    color: 'white',
    marginBottom: 20,
  },
});

export default SecondPage;
